import React from 'react'
import { useStyles } from './style'


const Input = ({type,name,onChange,onBlur,value,errors,touched})=>{

  const s = useStyles()

  return(
    <div className={s.divInput}>
      <div className={s.field}><input
        type={type}
        name={name}
        onChange={onChange}
        onBlur={onBlur}
        value={value}
      /></div>
      <div className={s.error}>{errors && touched && errors}</div>
    </div>

  )
}

export default Input
